import React from 'react'

function DinnerItem({image, name, price, ingredients, instructions}) {
  return (
    <div className='col-xs col-sm-6 dinnerItem'>
        <div style={{ backgroundImage: `url(${image})`}}></div>
      <h1> {name} </h1>
      <p> ${price} </p>
      <p> {ingredients} </p>
      <p> {instructions} </p>
    </div>
  )
}

export default DinnerItem
